import photo2 from '../../images/river2.png';
import photo3 from '../../images/river3.png';
import photo4 from '../../images/river4.png';



const images = [
  photo1,
  photo2,
  photo3,
  photo4
]


function Main(){
	return(
		<div className= "main">
			<div className = "mainDisplay">
				<Slider slides={images} alt={'screenshot'} />
			</div>
		</div>
	)
}
export default Main
